import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import { GoogleLogin } from 'react-google-login';

class App extends Component {
	constructor(props) {
		super(props);

		this.state = {};
	}

	componentDidMount() {
		this.fetchPhotos();
	}

	onSignIn = user => {
		console.log('ID Token: ', user);

		fetch('http://localhost:8888/server/confirmUser.php', {
			method: 'POST',
			headers: {
				'Content-Type': 'application/json'
			},
			body: JSON.stringify({
				id_token: user.tokenId
			})
		})
			.then(resp => resp.json()) // Transform the data into json
			.then(function(data) {
				// Create and append the li's to the ul
				console.log(data);
			});
	};

	responseGoogle = response => {
		console.log(response);
	};

	fetchPhotos = () => {
		fetch(
			'https://api.instagram.com/v1/tags/dogs/media/recent?access_token=4d5f68b936d24631b1a52f4e98d8dba7'
		)
			.then(res => {
				console.log('res', res.body);
				this.setState({
					photos: res.body.data
				});
			})
			.catch(err => console.log('error', err));
	};

	render() {
		return (
			<div className="App">
				<header className="App-header">
					<img src={logo} className="App-logo" alt="logo" />
				</header>
				<div className="clubSection">
					<p>FUCK</p>
				</div>
				<GoogleLogin
					clientId="1073431930974-rse6ic0teqt7jd401secn08m3ovdsf4l.apps.googleusercontent.com"
					buttonText="Login"
					onSuccess={this.onSignIn}
					onFailure={this.onSignIn}
				/>{' '}
			</div>
		);
	}
}

export default App;
